import React, { Component } from 'react';
import './App.css';

class App extends Component {

  state = {

    value: '',
  }
  render() {
    return (
      <div className="App">
        <form>
          <label htmlFor="user">Your Name :
            <input type="text" id="user" name="username" value={this.state.value} />
          </label>
        </form>
      </div>
    );
  }
}

export default App;
